import { Component } from '@angular/core';
import { ViewController, NavController, NavParams, ModalController, ToastController,Platform, LoadingController } from 'ionic-angular';
import { DetalleCotizacion } from './../../model/detalle-cotizacion';
import { CotizacionService } from './../../providers/cotizacion.service';
//Exportar
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;
 
import { File } from '@ionic-native/file';
import { FileOpener } from '@ionic-native/file-opener';
import { Function } from '../../utils/functions';


@Component({
  selector: 'page-info-cotizacion',
  templateUrl: 'info-cotizacion.html',
})
export class InfoCotizacionPage {
  pdfObj = null;
  listaDetalle:Array<DetalleCotizacion>;
  cabecera;
  total=0.0;
  subTotal=0.0;
  currency:string ='$';
  impuestos;
  constructor(public navCtrl: NavController, public navParams: NavParams, public _cotizacionService:CotizacionService, private platform: Platform, private file: File, private fileOpener: FileOpener,public loadingCtrl: LoadingController) {
    this.cabecera =this.navParams.get('item');
    this._cotizacionService.obtenerImpuestos().then(result=>{
      this.impuestos=result[0];
      this._cotizacionService.listaDetalle(this.cabecera.idCotizacion).then(data=>{
        this.total = 0;
        for(let detalle of data){
          this.total +=Math.round(Number(detalle.precio)*Number(detalle.cantidad) * 100) / 100;
          detalle.precio =Math.round(Number(detalle.precio)/(Number(this.impuestos.Rate)+1)  * 100) / 100;
          this.subTotal +=Math.round((Number(detalle.precio)*Number(detalle.cantidad)) * 100) / 100;
        }
        this.listaDetalle = data;
        let usuario = JSON.parse(window.sessionStorage.getItem("usuario"));
        this.currency = Function.getCurrency(usuario.pais);
        this.crearPDF();
      });
    });
  }
  exportarCotizacion(){
    if (this.platform.is('cordova')) {
      this.pdfObj.getBuffer((buffer) => {
        var blob = new Blob([buffer], { type: 'application/pdf' });
 
        // Save the PDF to the data Directory of our App
        this.file.writeFile(this.file.dataDirectory, 'cotizacion_'+this.cabecera.idCotizacion+'.pdf', blob, { replace: true }).then(fileEntry => {
          // Open the PDf with the correct OS tools
          this.fileOpener.open(this.file.dataDirectory + 'cotizacion_'+this.cabecera.idCotizacion+'.pdf', 'application/pdf');
        })
      });
    } else {
      // On a browser simply use download!
      this.pdfObj.download();
    }
  }
  buildTableBody(data, columns) {
    let body = [];
    let columnas = ['Nombre de Art√≠culo','Promocional','Cantidad','Precio','Sub Total'];
    body.push(columnas);
    let me = this;
    data.forEach(function(row) {
        var dataRow = [];
        columns.forEach(function(column) {
            let usuario = JSON.parse(window.sessionStorage.getItem("usuario"));
            me.currency = Function.getCurrency(usuario.pais);
            if(column === 'articulo'){
              dataRow.push(me.currency+' '+((Math.round(((Number(row['precio']))*Number(row['cantidad']))*100)/100)).toString().toString().replace(/\B(?=(\d{3})+(?!\d))/g, ","));
            }else if(column === 'precio' ){
              dataRow.push(me.currency+' '+row[column].toString().toString().replace(/\B(?=(\d{3})+(?!\d))/g, ","));
            }else{
              dataRow.push(row[column].toString());
            }
            
        })
        body.push(dataRow);
    });
    return body;
  }
  crearPDF(){
    let docDefinition = {
      content: [
        { alignment: 'right',fit: [100,100],image: 'data:image/jpeg;base64,'},
        { text: 'Alcance Integral S. A.', decoration: 'underline',fontSize:16,bold:true, style:'story', margin: [0, 0, 0, 20]},
        { text: 'Cotizaci√≥n # '+this.cabecera.idCotizacion, style: 'header', alignment: 'right' },
        { text: 'Fecha de aprox. entrega '+this.cabecera.fechaEntrega, style: 'total', alignment: 'right', bold:false },
        { text: 'Fecha de expiraci√≥n '+this.cabecera.fechaVencimiento, style: 'total', alignment: 'right', bold:false },
        { text: '', style:'espacio'},
        { text: this.cabecera.codigoCliente, style: 'titulo' },
        { text: this.cabecera.cliente, style: 'titulo' },
        { text: 'Direcci√≥n de entrega, '+this.cabecera.direccionEntrega, bold:false, fontSize: 10},
        { text: 'Empleado del departamento de ventas, '+this.cabecera.vendedor,style:'titulo',fontSize: 9, alignment: 'left',margin: [0, 0, 0, 10], bold: false },
        { text: 'Detalle de Cotizaci√≥n', style: 'story', margin: [0, 20, 0, 5] },
        { table: {
          widths: [100, 70, 100, 100, 100],
            headerRows: 1,
            body: this.buildTableBody(this.listaDetalle,['articulo','promocional','cantidad','precio','articulo'])
          },
          fontSize: 9,
          alignment: 'justify',
          style: 'tabla',
          layout: {
            fillColor: function (rowIndex, node, columnIndex) {
              return (rowIndex % 2 === 1) ? 'whitesmoke' : null;
            },
            hLineWidth: function (i, node) {
              return (i === 0 || i === node.table.body.length) ? 0.5 : 0.5;
            },
            vLineWidth: function (i, node) {
              return (i === 0 || i === node.table.widths.length) ? 0.5 : 0.5;
            },
            hLineColor: function (i, node) {
              return (i === 0 || i === node.table.body.length) ? '#ccc' : '#ccc';
            },
            vLineColor: function (i, node) {
              return (i === 0 || i === node.table.widths.length) ? '#ccc' : '#ccc';
            }
          }
        },
        { text: 'Sub Total   '+this.currency +' '+ (Math.round(this.subTotal*100)/100).toString().toString().replace(/\B(?=(\d{3})+(?!\d))/g, ","),
          alignment: 'right',
          style: 'total'
        },
        { text: 'Impuesto '+this.currency +' '+(Math.round((this.total*Number(this.impuestos.Rate)) * 100) / 100).toString().toString().replace(/\B(?=(\d{3})+(?!\d))/g, ","),
          alignment: 'right',
          style: 'total'
        },
        { text: 'Total '+this.currency +' '+(Math.round(this.total*100)/100).toString().toString().replace(/\B(?=(\d{3})+(?!\d))/g, ","),
          alignment: 'right',
          style: 'total'
        },
        { text: '', style:'espacio'},
        { text: '', style:'espacio'},
        { text: '_____________________________________',alignment: 'center'},
        { text: 'Firma y sello de '+this.cabecera.cliente,alignment: 'center',fontSize: 8},
        { text: '',alignment: 'center',fontSize: 9,margin: [0,5,0,0]},
        { text: 'Autorizado por:  ',alignment: 'center',fontSize: 8,margin:[0,0,125,0]}
      ],
      styles: {
        header: {
          fontSize: 14,
          bold: true
        },
        total:{
          fontSize: 10,
          bold: true
        },
        espacio:{
          margin: [0,0,0,50]
        },
        titulo: {
          fontSize: 12,
          bold: true,  
          margin: [0, 0, 0, 2]
        },
        subheader: {
          fontSize: 14,
          margin: [0, 0, 0, 50]
        },
        story: {
          italic: true,
          bold: true,
          fontSize: 16,
          alignment: 'center',
          width: '50%',
        },
        story2: {
          italic: true,
        },
        tabla:{
          margin: [0, 5, 0, 15]
        }
      }
    }
    this.pdfObj = pdfMake.createPdf(docDefinition);
  }
  cargarPedido(){
    console.log(this.cabecera);
  }
}
